import Header from './Header';
import Main from './Main';
import Footer from './Footer';
import PopupWithForm from './PopupWithForm';
import ImagePopup from './ImagePopup';
import Card from './Card';
import React from 'react';

function App() {
  //switch state for edit profile popup:
  const [isEditProfilePopupOpen, setIsEditProfilePopupOpen] = React.useState(false);
  //switch state for edit avatar popup:
  const [isEditAvatarPopupOpen, setIsEditAvatarPopupOpen] = React.useState(false);
  //switch state for adding a place popup:
  const [isAddPlacePopupOpen, setIsAddPlacePopupOpen] = React.useState(false);
  //switch state for image popup:
  const [selectedCard, setSelectedCard] = React.useState(null);

  function handleEditProfileClick() {
    setIsEditProfilePopupOpen(!isEditProfilePopupOpen);
  }

  function handleAddPlaceClick() {
    setIsAddPlacePopupOpen(!isAddPlacePopupOpen);
  }

  function handleEditAvatarClick() {
    setIsEditAvatarPopupOpen(!isEditAvatarPopupOpen);
  }

  function handleCardClick(curentCard) {
    setSelectedCard(curentCard);
  }

  function closeAllPopups() {
    setIsEditProfilePopupOpen(false);
    setIsAddPlacePopupOpen(false);
    setIsEditAvatarPopupOpen(false);
    setSelectedCard(false);
  }

  return (
    <div className="App">
      <Header />
      <Main
        onEditProfile={handleEditProfileClick}
        onAddPlace={handleAddPlaceClick}
        onEditAvatar={handleEditAvatarClick}
        onCardClick={handleCardClick}
      />
      <Footer />
      <ImagePopup card={selectedCard} onClose={closeAllPopups} />
      <PopupWithForm
        popupName="popup_type_edit"
        popupTitle="Редактировать профиль"
        isOpen={isEditProfilePopupOpen}
        onClose={closeAllPopups}
        buttonName="Сохранить"
        buttonNameIsLoad="Сохранение..."
      >
        <input
          id="input-name"
          type="text"
          name="name"
          className="popup__input popup__input_data_name"
          required
          minLength="2"
          maxLength="40"
          placeholder="Имя"
        />
        <span id="input-name-error" className="error"></span>
        <input
          id="input-job"
          type="text"
          name="job"
          className="popup__input popup__input_data_job"
          required
          minLength="2"
          maxLength="200"
          placeholder="О себе"
        />
        <span id="input-job-error" className="error"></span>
      </PopupWithForm>
      <PopupWithForm
        popupName="popup_type_card"
        popupTitle="Новое место"
        isOpen={isAddPlacePopupOpen}
        onClose={closeAllPopups}
        buttonName="Создать"
        buttonNameIsLoad="Создание..."
      >
        <input
          id="input-place"
          minLength="2"
          maxLength="30"
          type="text"
          name="place"
          placeholder="Название"
          className="popup__input popup__input_data_place"
          required
        />
        <span id="input-place-error" className="error"></span>
        <input
          id="input-link-card"
          type="url"
          name="link"
          placeholder="Ссылка на картинку"
          className="popup__input popup__input_data_link"
          required
        />
        <span id="input-link-card-error" className="error"></span>
      </PopupWithForm>
      <PopupWithForm popupName="popup_type_deleteCard" popupTitle="Вы уверены?" buttonName="Да"></PopupWithForm>
      <PopupWithForm
        popupName="popup_type_avatar"
        popupTitle="Обновить аватар"
        isOpen={isEditAvatarPopupOpen}
        onClose={closeAllPopups}
        buttonName="Сохранить"
        buttonNameIsLoad="Сохранение..."
      >
        <input
          id="input-link-avatar"
          type="url"
          name="link"
          placeholder="Ссылка на аватар"
          className="popup__input popup__input_data_link"
          required
        />
        <span id="input-link-avatar-error" className="error"></span>
      </PopupWithForm>
      <Card />
      <ul className="elements"></ul>
    </div>
  );
}

export default App;
